import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import Breadcrumb from '../components/Breadcrumb';
import FaqContent from '../components/FaqContent';

const FAQ = () => {
  return (
    <>
    <Navbar/>
    <Breadcrumb/>
    <FaqContent/>
    <Footer/>
    </>

  )
}

export default FAQ
